import React from "react";

const About = () => {
  return (
    <div className="p-10 text-center">
      <h1 className="text-3xl font-bold text-purple-600">About Fluence House</h1>
      <p className="mt-4 text-gray-600">Connecting influencers & brands with trust and impact.</p>
    </div>
  );
};

export default About;
